INSERT INTO master_faq VALUES("1","Order Related Queries","Where is my Order?","You may check the progress of your dispatch in \'My Order History\', once \nyou login to your account using your registered email ID. In case your \norder is showing \"pending dispatch\", you will see a \"dispatch by\" date \nmentioned against your order. Or else if your order has been dispatched,\n you will see the courier details mentioned against your order.","Active","2013-12-11 22:00:03","admin","2013-12-11 22:41:40","admin");
INSERT INTO master_faq VALUES("2","Order Related Queries","My Order has been dispatched, when will I receive my product?","Once your product is dispatched, generally the courier takes 1-3 days to\n deliver the shipments. It might take about 7-10 days for bulk or heavy \nitems ( Ex: TV, Refrigerator etc ) as they move through surface \ntransport. ","Active","2013-12-11 22:43:47","admin","2013-12-11 22:55:01","admin");
