INSERT INTO products VALUES("5","2","Samsung Galaxy S4","sku001","Galaxy S4","<b>Overall Review</b><br>The next smart and big thing is here! Samsung Galaxy S4 is a highly anticipated flagship smartphone, a phone that has completely changed the definition of a smartphone. It is better to call this droid as King of the Beasts, giving credit to the master technology with which it is bestowed with. Galaxy S IV is the successor of the most successful Samsung Galaxy S3 and like its predecessor, Galaxy S4 too has jaw-dropping features that will take you to a completely different and new world where everything becomes very simple and hassle-free. Galaxy S series has created history in the smartphone world with its success and Galaxy S4 has taken this success a step ahead. In comparison to Galaxy S3, Galaxy S4 comes with expanded screen, slimmer body, premium finish, stylish design, full HD super AMOLED capacitive touchscreen, better battery, add-on features, new and unique sensors, latest applications, improvised software and redesigned user interface. All in all, Samsung Galaxy S4 has all those things that are yet not to be found in other contemporary smartphone, and thus all such combination makes it stand out from the crowd. The handset is designed to match your style and needs and to make you feel special among your companions.","IMG0000050.jpg","35490.00","10","Galaxy S4","Black","2GB RAM with an internal memory of 16/32/64 GB||Front Camera:2.0 MP||Camera:13.0 MP,4000 x 3000 Pixels","1","0.0","Active","","","2014-01-17 01:30:14","admin");
INSERT INTO products VALUES("6","4","Canon EOS 1100D","Can001","EOS 1100D","                        Advanced, compact and affordable: your first \nsteps into the world of DSLR photography, made simple with Canon EOS \n1100D.Key Features: Superior 12-megapixel image quality, On-screen \nFeature Guide, Creative Auto and Basic, HD video capture, ISO 100-6400 \nsensitivity, Wide-area 9-point AF system, 63-zone iFCL exposure \nmetering, 6.8cm (2.7), 230,000-dot screen, Use with all EF and EF-S \nlenses        ","IMG0000047.jpeg","24646.00","10","SLR","Brown","Focal Length: 18 - 55 mm||HD Recording||12.2 Megapixel Camera||2.7 TFT Color LCD Screen||CMOS Image Sensor","1","0.0","Active","2013-12-18 01:57:39","admin","2013-12-20 14:38:53","admin");
INSERT INTO products VALUES("7","2","Samsung Galaxy S Duos 2 S7582","Sam001","Duos 2 S7582","<div class=\"item_desc_text\">\n                <ul class=\"fk-key-features\"><li>5 MP Primary Camera</li><li>1.2 GHz Dual Core Application Processor</li><li>Expandable Storage Capacity of 64 GB</li><li>Wi-Fi Enabled</li><li>4-inch TFT Capactive Touchscreen</li><li>0.3 MP Secondary Camera</li><li>Android v4.2 (Jelly Bean) OS</li><li>Dual SIM (GSM + GSM)</li></ul>\n            </div>","IMG0000061.jpeg","10790.00","10","Galaxy S Duos 2","Black","","1","0.0","Active","2013-12-18 02:01:35","admin","2014-01-17 01:30:07","admin");
INSERT INTO products VALUES("8","6","My Journey : Transforming Dreams into Actions","bk01","","From a small boy growing up in Rameswaram, to becoming the country?s \neleventh President, A.P.J. Abdul Kalam?s life has been a tale of \nextraordinary determination, courage, perseverance and the desire to \nexcel. In this series of anecdotes and profiles, Dr Kalam looks back on \nkey moments in his past?some small and some momentous? and tells the \nreader how each of them inspired him profoundly. With warmth and \naffection, he talks about the people who left a deep impression on him \nas he was growing up and as an adult and the lessons he drew from his \ninteractions with them. He describes those who have been the closest to \nhim?his father with his deep love of God, his mother and her great \nkindness, his mentors who helped shape his thoughts and outlook. There \nare heart-warming accounts here of his childhood years spent in a small \ntown by the Bay of Bengal and the many struggles and sacrifices made on \nthe path to becoming a scientist and then the President of India. Dr \nKalam also writes about the times when failure and dejection nearly \novertook him and how he prevailed over those obstacles by drawing \nstrength from books and spirituality.<br><br>Nostalgic, honest and \ndeeply personal, My Journey is the story of a life as rich as it is \nunusual and the beautiful lessons to be learnt from it.        <br>","IMG0000046.jpeg","112.00","3","Paperback","","Authored By: A. P. J. Abdul Kalam","1","0.0","Active","2013-12-20 14:01:27","admin","2013-12-21 02:19:15","admin");
INSERT INTO products VALUES("9","6","The Race of My Life : An Autobiography","bk02","","Milkha Singh has led a life dominated by running, running and running. From a boy who narrowly escaped death during Partition (most of his family was not so lucky), to a juvenile delinquent who stole and outran the police, to a young Army recruit who ran his very first race to win special privileges for himself (a daily glass of milk). After that first race, Milkha Singh became an athlete by default. And what followed was the stuff legends are made of. In this remarkably candid autobiography, Milkha Singh shares the amazing highs of winning Indias first ever gold in athletics at the Commonwealth Games, the unbridled joy of being hailed as the Flying Sikh in Pakistan, as well as the shattering low of failure at the Olympics. Simple, yet ambitious; famous, yet grounded; temptations all around him, yet remaining celibate so he could focus on racing; a rich and beautiful girl who was desperate for him, yet fighting the world to marry his lady love, Nimmi, even as the on-field drama found its way into his personal life, Milkha was a man who defined his own destiny. And yet, for a man whose life was dominated by sports, he continues to remain disillusioned with the way sports is run. Powerful and gripping, The Race of My Life documents the journey of an impoverished refugee who rose to become one of the most towering figures in Indian sports. <br>","IMG0000045.jpeg","170.00","2","Paperback","","Authored By: Milkha Singh, Sonia Sanwalka||Foreword By: Rakeysh Omprakash Mehra||Introduction By: Jeev Milkha Singh||Publisher: Rupa Publications India (2013) ","1","0.0","Active","2013-12-20 14:03:20","admin","","");
INSERT INTO products VALUES("10","7","The Oath of the Vayuputras: Shiva Trilogy 3","bk03","","&nbsp;Summary of the Book<br><br>The Oath of the Vayuputras is the final book of the Shiva Trilogy. In the earlier books of the trilogy, Shiva finds out that the Nagas are not his enemies and joins hands with them to reach the root of all evil. This book will have answers to the Neelkanths questions about his fate, the choices he made previously and karma.<br><br>Further, in the concluding book of the trilogy, Shiva reaches Panchavati, the capital of Naga where he will come face to face with his greatest enemy. Will he win the battle over his wicked enemies, who are out to destroy him and his legacy?<br><br>The Oath of the Vayuputras will also reveal the reason of Shivas close friend Brahaspatis disappearance and reappearance at the end of the second book, The Secret of the Nagas. Further the relationship between Daksha, the king of Meluha and the mysterious temple priests will also be exposed in this last part of the trilogy. Shiva seeks helps from the Vayuputras in the quest to conquer all evil.<br><br>The great warrior will encounter the real intentions of some characters he deemed to be close to him. Some new characters will add that extra vitality to the entire plot, especially Shivas greatest enemy whose name sends shivers down the spines of many great warriors.<br><br>An interesting journey of a warrior who is turned into a God by his followers because of his deeds and war against the evil, this book is sure to have its readers full attention. A good read which will make one reflect on their actions, this book like the two earlier books of the trilogy focuses on philosophy, religion and the never ending battle between the good and the evil.<br><br>About Amish Tripathi<br><br>Amish Tripathi, is an author who gave up his banking job to live his dream of becoming a writer. He is an IIM (Kolkata) graduate and worked for 14 years in the financial services industry. He has penned down three books as part of the Shiva Trilogy 3, which have received raving reviews and critical appreciation. His style of writing is fresh and has given birth to a new era of literature in India. With philosophy, religion, karma and myth as his main areas of focus, Amish has weaved his plots around them and conquered the hearts of many readers with his riveting ideas. Amish lives with his wife Preethi and son Neel in Mumbai. As is evident from his books, Amish has a passion for religion, philosophy, mythology and history.","IMG0000044.jpeg","195.00","3","Paperback","","Author: Amish Tripathi||Publisher: Westland (2013)  \n","1","0.0","Active","2013-12-20 14:07:23","admin","","");
INSERT INTO products VALUES("11","8","Disney Lion King: Bug Stew","bk05","","Mini books with a delightful story in each, starring a best-loved Disney\n character. Help your child learn to read with colourful pictures, big, \nbold text and short sentences to make for easy reading. 12 stories in \nthe range including Winnie the Pooh and the Easter Egg Hunt, a Toy Story\n Backpack Adventure, Ballerina Princess, Cars Race Team adventure, \nFairies Hide and Seek, The Lion King \'Bug Stew\', a high-flying Dumbo \nstory and many more! Hardback, glossy, cased covers make these books \neasy to hold for little hands. Suitable for children aged 3-5 years to \nread alone, or read along with a grown-up. ","IMG0000043.jpeg","99.00","1","Paperback","","","1","0.0","Active","2013-12-20 14:10:40","admin","","");
